import './App.css';
const black_div = {
  backgroundColor: 'black',
  height: 'auto',
  width: '100%',
  position: 'absolute',
  fontSize: 12,
  color: '#FFF',
  display: 'inlineBlock',
  float: 'right',
  overflow: 'auto'

};
const row = {
  display: 'inlineBlock'
};
class App extends Component {
  render() {
    return (
      <div className=" App" style={black_div} >
        <div id="main">
          <div id="d2"><a id="a"href="https://www.olacabs.com/">Support   </a> </div>
          <div id="d2"><a id="a"href="https://www.olacabs.com/">Offers    |</a>  </div>
          <div id="d2"><a id="a"href="https://www.olacabs.com/">Share   |</a>    </div>
          <div id="d2"><a id="a"href="https://www.olacabs.com/">Ola Corporate   |</a>    </div>
          <div id="d2"><a id="a"href="https://www.olacabs.com/">Ola Money   |</a> </div>
          <div id="d2"><a id="a"href="https://www.olacabs.com/">Drive with Ola            |</a>     </div>
        </div>
      </div>
    );
  }
}

export default App;
